import React, { useState } from 'react';

const Slidehome = () => {
    const [name, setName] = useState('')

    function handleChange(e) {
        setName(e.target.value);
        console.log(setName)
    }

    return (
        <>

            <input
                type="text"
                name="firstName"
                onChange={handleChange}
                value={name} />
        </>

    );
}

export default Slidehome;
